import React from 'react'
import '../styles/SearchCard.css';

const SearchCard = (props) => {

    const charityId = () => {
        const charities = props
        charities.find(charity => charity.id === props.id)
    }

    return(
        <div id="searchCard" onClick={charityId}>
           {props.charity_name}
        </div>
    )
}
export default SearchCard
